import Layout from './components/layout'
import "../styles/list.css";

export default class List extends Component {
    state = {
        list: ["Hello", "World"]
    }
    render() {
        return (
            // <Layout>
                <div>
                    <ul>
                        {
                            this.state.list.map(item => (
                                // <li onClick={()=>Router.push('/detail?arg='+item)}>{item}</li>
                                <li>{item}</li>
                            ))
                        }
                    </ul>
                </div>
            // </Layout>
        )
    }
}
